import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';
import { HashRouter  } from 'react-router-dom';

const rootElement = document.getElementById('root');
const root = createRoot(rootElement);

root.render(
  <React.StrictMode>
    <HashRouter>
      <App />
    </HashRouter>
  </React.StrictMode>
);
